import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {
  return (
    <div className='hero-container'>
      <video src='/videos/video-1.mp4' autoPlay loop muted />
      <h1>FOOD RECOVERY NETWORK AT BROWN</h1>
      <p>Fight waste. Feed people.</p>
      <div className='hero-btns'>
  <a href="https://docs.google.com/spreadsheets/d/1YuzBM5KBdwxv-IPzfpTOIvmTidpL37fYNjkDT_su4u0/edit#gid=0" target="_blank" rel="noopener noreferrer">
    <Button
      className='btns'
      buttonStyle='btn--outline'
      buttonSize='btn--large'
    >
      JOIN OUR TEAM
    </Button>
  </a>
  <Button
    className='btns'
    buttonStyle='btn--outline'
    buttonSize='btn--large'
  >
    GET STARTED
  </Button>
</div>
    </div>
  );
}

export default HeroSection;
